INSERT INTO `scripts` VALUES ('AccountGroups.php',10,'Defines the groupings of general ledger accounts'),('AccountSections.php',10,'Defines the sections in the general ledger reports'),('AddCustomerContacts.php',3,'Adds customer contacts'),('AddCustomerNotes.php',3,'Adds notes about customers'),('AddCustomerTypeNotes.php',3,''),('AgedControlledInventory.php',11,'Report of Controlled Items and their age'),('AgedDebtors.php',2,'Lists customer account balances in detail or summary in selected currency'),('AgedSuppliers.php',2,'Lists supplier account balances in detail or summary in selected currency'),('AnalysisHorizontalIncome.php',8,'Shows the horizontal analysis of the statement of comprehensive income'),('AnalysisHorizontalPosition.php',8,'Shows the horizontal analysis of the statement of financial position'),('Areas.php',3,'Defines the sales areas - all customers must belong to a sales area for the purposes of sales analysis'),('AuditTrail.php',15,'Shows the activity with SQL statements and who performed the changes'),('AutomaticTranslationDescriptions.php',15,'Translates via Google Translator all empty translated descriptions'),('BankAccountBalances.php',1,'Shows bank accounts authorised for with balances'),('BankAccounts.php',10,'Defines the general ledger code for bank accounts and specifies that bank transactions be created for these accounts for the purposes of reconciliation'),('BankAccountUsers.php',15,'Maintains table bankaccountusers (Authorized users to work with a bank account in webERP)'),('BankMatching.php',7,'Allows payments and receipts to be matched off against bank statements'),('BankReconciliation.php',7,'Displays the bank reconciliation for a selected bank account'),('BOMExtendedQty.php',2,'Shows the component requirements to make an item'),('BOMIndented.php',2,'Shows the bill of material indented for each level'),('BOMIndentedReverse.php',2,''),('BOMInquiry.php',2,'Displays the bill of material with cost information'),('BOMListing.php',2,'Lists the bills of material for a selected range of items'),('BOMs.php',9,'Administers the bills of material for a selected item'),('COGSGLPostings.php',10,'Defines the general ledger account to be used for cost of sales entries'),('CollectiveWorkOrderCost.php',2,'Multiple work orders cost review'),('CompanyPreferences.php',10,'Defines the settings applicable for the company, including name, address, tax authority reference, whether GL integration used etc.'),('ConfirmDispatchControlled_Invoice.php',11,'Specifies the batch references/serial numbers of items dispatched that are being invoiced'),('ConfirmDispatch_Invoice.php',2,'Creates sales invoices from entered sales orders based on the quantities dispatched that can be modified'),('ContractBOM.php',6,'Creates the item requirements from stock for a contract as part of the contract cost build up'),('ContractCosting.php',6,'Shows a contract cost - the components and other non-stock costs issued to the contract'),('ContractOtherReqts.php',4,'Creates the other requirements for a contract cost build up'),('Contracts.php',6,'Creates or modifies a customer contract costing'),('CopyBOM.php',9,'Allows a bill of material to be copied between items'),('CostUpdate',10,'NB Not a script but allows users to maintain item costs from withing StockCostUpdate.php'),('CounterReturns.php',5,'Allows credits and refunds from the default Counter Sale account for an inventory location'),('CounterSales.php',1,'Allows sales to be entered against a cash sale customer account defined in the users location record'),('CreditItemsControlled.php',3,'Specifies the batch references/serial numbers of items being credited back into stock'),('CreditStatus.php',3,'Defines the credit status records. Each customer account is given a credit status from this table. Some credit status records can prohibit invoicing and new orders being entered.'),('Credit_Invoice.php',3,'Creates a credit note based on the details of an existing invoice'),('Currencies.php',9,'Defi